*Free VPN is available once you shared network
This application enables the Wi-Fi connection, management and security protection for each user. The features includes:
1. Manage different WLAN routers across vendors, it totally support 39 router brands, e.g. Linksys, TP-Link, Netgear, Belkin, D-Link, over 60 models are supported. It also supports the access credential modification and MAC filter to enable restrict network controls;
2. It allows the QR-Code sharing and scan to fetch the WIFI network access permission, the network owner will share his network easily with his friends even a complicated password is used;
3. When the owner leaves home, he can share his router for other members usage, and gain extra WIFI credits for further network access into other members network;
4. If a user went to a new location and would like to get the WIFI access nearby, he can simply send a SMS to fetch the accessible network access information if there is such a network and the owner allows it, and the application will install that network while the user needn't to know the exact access token.
5. To secure the wireless network traffic, even using the free non-password wireless network, the VPN is the best known solution for this, this application also offer the VPN service.

This app is the first one that can secure the network and enable the network access on iOS
At present it supports to manage 2Wire(2701HG-B), Actiontec(GT701),Aigale(AI-BR100, AI-R9910), Amped(R10000), Arcadyan(Deutche Telekom), Asus(RT-N10E), AVM(Fritz!Box), Belkin(F7D2301, F9K1005, F6D423),B-Link(MP01),Buffalo(WZR-HP-G300NH2, WCR-GN),Cisco-Linksys(E1200, EA2700, WRT54GS),D-Link(DIR-604, DIR-601),Engenious(ESR600H),FON(Fon2100, Fonero), Fast(FWR171), H3C(WBR204n), Hame(A5), Handlink(WG-602), Huawei(HG232f, ES21M, HG523a), IP-Com(W614R), IpTime(N104i), JCG(JYR-N490), LevelOne, Logitec(LAN-W150N), MediaLink(MWN-WAPR150N), Mercury(MW150RM), Netgear(JWNR2000, WGR612, WGR614), Phicomm(M1), Sitecom(WL122),T&W(E5500, AI-R990), Tenda(810R, A5s), Thomson(TG585), Totolink(N2), TP-Link(WR700N, WR740N, etc), Vivick(Q-W601), Vizio(XWR100), Westell(7500), Zyxel(MINI N), ZTE(E5500), Xiaomi, HiWiFi over 41 brands were supported
